import { Route, Routes } from "react-router-dom";
import Home from "./pages/Home";
import About from "./pages/About";

const App = () => {
  return (
    <Routes>
      <Route
        path={`${process.env.PUBLIC_URL}/`}
        element={<Home></Home>}
      ></Route>
      <Route
        path={`${process.env.PUBLIC_URL}/about/:id`}
        element={<About></About>}
      ></Route>
    </Routes>
  );
};
export default App;
